INSERT INTO `news` VALUES (1,'My Fresh Shirt Freshens Up','Our website has been sent through the spin cycle and comes to you a little fresher than before. Come see how easy it is to click your way to clean clothes.',1,'2009-04-05 14:18:19','2009-07-15 11:26:32'),(4,'New York Magazine Votes My Fresh Shirt Best in Show!','My Fresh Shirt continues to turn heads and gain momentum by earning its place in New York magazine’s “Best of NYC 2009” edition!  \r\n\r\nhttp://nymag.com/bestofny/services/2009/online-cleaners/\r\n',1,'2009-07-15 11:30:01','2009-07-15 11:31:15'),(7,'My Fresh Shirt makes a Reservation at W Hotels – NYC','My Fresh Shirt has been featured in Daily Candy’s Guide to NYC Booklet for W Hotel, providing valet service for eco-friendly guests who demand the best!\r\n',1,'2009-07-15 11:32:31','2009-07-15 11:32:31'),(10,'InStyle Magazine Features My Fresh Shirt - NYC','InStyle Magazine makes special note of My Fresh Shirt’s dedication to the environment while being stylish – Sela Ward just so happens to be one of My Fresh Shirt’s satisfied customers! \r\n',1,'2009-07-15 11:35:57','2009-07-15 11:39:01'),(13,'The Daily Candy Gets With The Freshness','The Daily Candy dishes out the sweet news to all their users by itemizing the morning rush of your daily New Yorker. \r\n\r\nhttp://www.dailycandy.com/new_york/article/37959/Freshness+Direct\r\n',1,'2009-07-15 11:38:23','2009-07-15 11:38:23');
