INSERT INTO `notes` VALUES (1,NULL,170,'','2009-04-07 11:50:15','2009-04-07 13:36:12','Complaint'),(3,NULL,146,'I received my dry cleaning back on Monday.  Everything looks great, except one sweater is missing a large kilt pin that was attached, as its closure. \r\n---------------------------------------\r\nMFS Customer Service:\r\n\r\nSarah,\r\n\r\nWe are looking into your lost item claim.  Please provide color, brand, pattern to help us identify the item.\r\n\r\nSincerely,\r\n\r\n----------------------------------------','2009-04-10 08:41:04','2009-04-13 10:04:30','Lost'),(4,NULL,173,'test 1\r\n\r\n\r\n\r\nresponse 1\r\n','2009-04-13 07:45:53','2009-04-13 07:48:42','Damaged Item'),(5,NULL,173,'test 2\r\n','2009-04-13 07:46:10','2009-04-13 07:46:10','Note'),(6,NULL,173,'test 3','2009-04-13 07:46:26','2009-04-13 07:46:26','Lost'),(7,NULL,173,'test 4\r\n','2009-04-13 07:46:41','2009-04-13 07:46:41','Damaged Item'),(8,NULL,150,'I am missing two sweaters from my dry cleaning delivery (last week). One is a long-sleeved cashmere bendel cowl neck sweater (cream) the other is short-sleeved cashmere bcbg cowl neck sweater. Both did not come back with my other pieces. \r\n\r\n\r\n*** UPDATE*** MY APOLOGIES, MY DOORMAN HAD PUT THE CLOTHING TO GO TO ANOTHER APARTMENT BUILDING. I HAVE RECEIVED MY MISSING ITEMS. THANK YOU. ','2009-04-13 19:19:41','2009-04-15 04:58:23','Note'),(9,NULL,173,'complaint test for email notification','2009-04-15 06:51:55','2009-04-15 06:51:55','Complaint'),(10,NULL,155,'This order was picked up this morning and included both one bag of wash and fold and one bag of shirts and dry cleaning.  I don\'t see the shirts and dry cleaning on this order and was wondering where it will appear on my online record.\r\n\r\nPlease let me know.  Thanks.\r\n\r\nmark burstein','2009-04-16 21:49:44','2009-04-16 21:49:44','Note'),(11,NULL,155,'The current order also states that the order is awaiting pickup, but it was picked up this morning.  ','2009-04-16 21:50:43','2009-04-16 21:50:43','Note'),(12,NULL,155,'I also wanted to note that no laundry bags were brought when pickup of the first order occurred this morning.  It\'s not a big deal but for your information.','2009-04-16 21:52:39','2009-04-16 21:52:39','Note'),(13,NULL,193,'test complaint','2009-04-16 23:40:14','2009-04-16 23:40:14','Complaint'),(14,NULL,175,'How much was I charged in total for my order? Thanks','2009-04-18 15:38:24','2009-04-18 15:38:24','Complaint'),(16,202,194,'Hello.\r\n\r\nI have entered the freetrial code upon checkout but is not being reflected on the current bill. \r\n\r\nI would like to utilize MY FREE TRIAL for this first order.\r\n\r\nThank you.\r\nCat Tsui \r\n\r\n--------------------------\r\n\r\nDear Cat,\r\n\r\nThe $25 Free Trial has been applied to your credit card.\r\n\r\nSincerely,\r\n\r\nMFS Customer Service\r\n','2009-04-22 01:45:11','2009-05-07 13:03:03','Note'),(17,NULL,173,'4/23 test complaint email','2009-04-23 06:54:53','2009-04-23 06:54:53','Complaint'),(18,NULL,26,'my clothes have not been returned to my apt... they are supposed to be returned on wednesdays.. my cleaning lady is sitting there with nothing to do.. i am paying her to do nothing.. so thank u.. ','2009-04-23 09:35:19','2009-04-23 09:35:19','Complaint'),(20,NULL,NULL,'Door Code for entry is 5551*','2009-04-29 07:31:22','2009-04-29 07:31:22','Note'),(21,NULL,173,'4/29 test complaint','2009-04-29 13:19:56','2009-04-29 13:19:56','Complaint'),(22,NULL,173,'4/29 test complaint','2009-04-29 13:20:02','2009-04-29 13:20:02','Complaint'),(23,NULL,173,'4/29 test complaint','2009-04-29 13:20:02','2009-04-29 13:20:02','Complaint'),(24,NULL,177,'How soon will somebody respond to me, I am irate, the clock starts now, its ticking ticking ticing boom, time 11:47 PST, ill let you know how long it  takes','2009-05-02 01:48:15','2009-05-02 01:48:15','Complaint'),(25,NULL,226,'I set up a pickup and delivery and no one came.  Then I emailed to inquire and no one replied.\r\n\r\nI\'d like to cancel my account.  Please tell me how to do so.\r\n\r\nThanks','2009-05-07 23:15:31','2009-05-07 23:15:31','Complaint'),(27,NULL,150,'','2009-05-13 11:08:22','2009-05-13 11:08:22','Note'),(28,663,241,'Hi - the intercom on my building sometimes does not work, and I have not yet received my scheduled delivery for 5/14 between 6a-8a. \r\n\r\nCan the delivery person please call when he is downstairs so I can let him in? I have been home the entire delivery window.\r\nThanks\r\nJames','2009-05-14 06:44:53','2009-05-14 06:44:53','Note'),(29,NULL,241,'I have  rescheduled a delivery for today, 5/14 for 8-10pm.\r\nMy intercom may not be working, please have delivery CALL at arrival:\r\n(646) 361 - 2153','2009-05-14 07:45:57','2009-05-14 07:45:57','Note'),(30,755,194,'Wash & Fold Items:\r\nPlease separate whites from darks/colors.\r\n\r\nAdditional Dry Cleaning Items\r\n1 BLK Sweater\r\n1 GREY Pant\r\n\r\nSpecial Care for Laundry\r\n4 Tops\r\n2 Underwear\r\nCan be machine washed with rest of laundry batch. Please hang-dry, DO NOT place in the dryer. \r\n\r\nThank You\r\n\r\n','2009-05-18 18:59:53','2009-05-18 18:59:53','Note'),(31,NULL,254,'I had scheduled my first pick up for last night between 6 and 8 pm. The driver did not have either the laundry or dry clean bag and could not be bothered to go down to his truck and get new ones to provide to me so i was made to stuff my clothes in other bags. Now that I check the status of my order  online, it still says \"awaiting pickup\" so i am concerned that my clothes never made it to your facility. Can you please confirm that you do have my clothing and the the order is being processed? \r\n\r\nJon Price','2009-05-20 08:21:15','2009-05-20 08:21:15','Complaint'),(32,NULL,46,'I sent in two pairs of shoes for cleaning. When should I receive them back?','2009-05-22 08:23:14','2009-05-22 08:23:14','Complaint'),(33,NULL,46,'I sent in two pairs of shoes for cleaning. When should I receive them back?','2009-05-22 08:23:21','2009-05-22 08:23:21','Complaint'),(34,NULL,172,'i ordered yesterday at about 10pm.  for pickup tuesday 6am-8am today.\r\n\r\nthough i saw a confirmation on the screen which said \"your order has been received...\", i didn\'t receive an email confirmation.\r\n\r\nand no order appears on my account on the website.\r\n\r\ndid this order not go through?\r\n\r\nthanks,\r\nnick','2009-06-09 07:02:26','2009-06-09 07:02:26','Complaint'),(35,NULL,30,'Hello,\r\n\r\nI put in an order last night to be picked up this morning, no one picked it up today.\r\n\r\nI also called today at 4pm to my doorman to check if anything had been picked up and nothing had been.  Then I called you and no one answered/returned my call.  I found another laundry to take care of what I had left for you to pick up.\r\n\r\nI would like to cancel my fresh shirt membership.  We are moving on June 26th.  \r\n\r\nThank you  Melissa Meltzer','2009-06-09 20:13:22','2009-06-09 20:13:22','Complaint'),(36,1261,77,'I have a shirt with white shirt with french collars in my order, could you please clean the cuffs well! thanks. ','2009-06-11 11:50:33','2009-06-11 11:50:33','Note'),(37,1365,290,'My last order was supposed to receive the $25 trial discount - I don\'t think the discount was applied. Could you check your records and apply it to this order if I have not used it yet?','2009-06-17 20:58:43','2009-06-18 08:27:15','Note'),(39,1443,14,'Please call 212.677.6101 when at door...my buzzer does not work\r\n','2009-06-21 22:24:02','2009-06-21 22:24:02','Note'),(43,NULL,69,'Please try to pick-up/deliver between 9am & 1pm.','2009-06-26 12:12:49','2009-06-26 12:12:49','Note');
