INSERT INTO `notification_templates` VALUES (1,'signup_thanks','<p>Dear {{user.first_name}},</p><p>Welcome to My Fresh Shirt, New York City\'s first eco-friendly personal valet service!</p><p>Your new membership will enable you to click your way to clean clothes while doing your part in helping save the environment.</p><p>Remember, time is our most precious commodity. Charles Buxton said, You will never find time for anything. If you want time you must make it. So, My Fresh Shirt will help you make time to enjoy life!</p><p>Best Regards,</p><p>My Fresh Shirt</p><p>Use of the My Fresh Shirt service and Web site constitutes acceptance of our Terms of Use and Privacy Policy.</p>','<p>Dear {{user.first_name}},</p><p>Welcome to My Fresh Shirt, New York City\'s first eco-friendly personal valet service!</p>','2009-04-01 10:28:27','2009-06-22 09:46:45'),(2,'new_password','<p>We\'re sorry to hear you lost your password. But, there\'s no need to worry, because we\'ve created a new, temporary password for you.</p><p>Your new password is: {{new_password}}</p><p>You can change this password once you log into your account.</p>','<p>Your new password is: {{new_password}}</p><p>You can change this password once you log into your account.</p>','2009-04-01 10:28:27','2009-06-22 09:45:33'),(3,'order_payment_thanks','<div>Dear {{user.name}},</div><h1 class=\'green\'>THANK YOU!</h1><p>Your Order ID: <strong>{{order.identifier}}</strong></p><p>Thank you for your recent order with us. Your business is greatly appreciated. If there are any questions, please feel free to <a href=\'www.myfreshshirt.com/contact_us\'>Contact Us</a></p><p>The MyFreshShirt Team</p>','<div>Dear {{user.name}},</div><h1 class=\'green\'>THANK YOU!</h1><p>Your Order ID: <strong>{{order.identifier}}</strong></p>','2009-04-01 10:28:27','2009-05-06 20:01:46'),(4,'order_cancellation','<div><p>Dear {{order.customer.first_name}},</p></div><p>We have received your request for cancellation of order #{{order.tracking_number}}. Please visit us at www.myfreshshirt.com or email us at customerservice@myfreshshirt.com to re-schedule.</p><p>We look forward to servicing your dry cleaning and laundry needs!</p><p>Best regards,</p><p>My Fresh Shirt</p>','Dear {{order.customer.first_name}}, We have received your request for cancellation of order #{{order.tracking_number}}. ','2009-04-01 10:28:27','2009-05-06 20:05:31'),(5,'contact_message','<div><p>{{message}}</p></div></p><br><span><p>From: </span>{{customer}}</p>','<div><p>{{message}}</p></div></p><br><span><p>From: </span>{{customer}}</p>','2009-04-01 10:28:27','2009-05-06 20:05:42'),(6,'new_complaint','<p>Dear Administrator,</p><p>There\'s been a new complaint made for Order Number: {% if note.order %}{{note.order.identifier}}{% endif %}</p><p>Note:</p><p>{{note.body}}</p>','A new complaint made for Order Number: {% if note.order %}{{note.order.identifier}}{% endif %}</p><p>Note:</p><p>{{note.body}}</p>','2009-04-01 10:28:27','2009-05-06 20:06:20'),(7,'failed_cancellation','<p>Dear {{ order.customer.first_name | capitalize }}</p><p>We have received your request for cancellation. Unfortunately your order #{{order.tracking_number}} has already entered the treatment process and may not be canceled.</p><p>Your order is scheduled to return to you on {{order.delivery_date}}.</p><p>For any questions please contact us at www.myfreshshirt.com, or email customerservice@myfreshshirt.com,</p><p>Best regards,</p><p>My Fresh Shirt</p>','Unfortunately your order #{{order.tracking_number}} has already begun processing and may not be canceled.','2009-04-01 10:28:27','2009-05-06 20:08:00'),(8,'service_request_confirmation','<p>Dear {{customer.first_name | capitalize}},</p><p>Thank you for your recent inquiry. A member from the My Fresh Shirt team will contact you within 24 hours.</p><p>At My Fresh Shirt we are constantly looking for ways to improve our services and our customer\'s experience. Please know, the time you have taken to contact us is very much appreciated.</p><p>We look forward to servicing your dry cleaning and laundry needs!</p><p>Best regards,</p><p>My Fresh Shirt</p>','<p>Thank you for your recent inquiry. A member from the My Fresh Shirt team will contact you within 24 hours.</p>','2009-04-01 10:28:27','2009-05-06 20:08:24'),(9,'not_serviced_notice','<p>Dear {{customer.first_name}},</p><p>Unfortunately we do not service your area at this time.</p><p>However, your information has been stored and we\'ll let you know as soon as we do!</p><p>Best Regards,</p><p>My Fresh Shirt</p>','<p>Dear {{customer.first_name}},</p><p>Unfortunately we do not service your area at this time.</p>','2009-04-01 10:28:27','2009-05-06 20:08:36');
