  `weight` decimal(6,2) default '1.00',
  `verified` tinyint(1) default NULL,
  `status` varchar(255) default NULL,
  `processed` tinyint(1) default NULL,
  `position` int(11) default NULL,
  `destination` int(11) default NULL,
  `price` decimal(9,2) default NULL,
  `water_cost` decimal(9,2) default NULL,
  `carbon_cost` decimal(9,2) default NULL,
  `point_value` int(11) default NULL,
  `bin_id` int(11) default NULL,
  `rack_id` int(11) default NULL,
  `order_part_id` int(11) default NULL,
  `premium` tinyint(1) default NULL,
  `ls_starch` tinyint(1) default NULL,
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=6431 DEFAULT CHARSET=utf8;

