--
-- Table structure for table `orders`
--

DROP TABLE IF EXISTS `orders`;
CREATE TABLE `orders` (
  `id` int(11) NOT NULL auto_increment,
  `customer_id` int(11) default NULL,
  `count` int(11) default NULL,
  `shipping` decimal(6,2) default NULL,
  `delivery_type` int(11) default NULL,
  `created_at` datetime default NULL,
  `updated_at` datetime default NULL,
  `verified` tinyint(1) default NULL,
  `status` varchar(255) default NULL,
  `amount` decimal(8,2) default NULL,
  `processed` tinyint(1) default NULL,
  `instructions_id` int(11) default NULL,
  `tracking_number` varchar(255) default NULL,
  `recurring` tinyint(1) default '0',
  `finalized` tinyint(1) default NULL,
  `tax` decimal(9,2) default NULL,
  `carbon_cost` decimal(9,2) default NULL,
  `water_cost` decimal(9,2) default NULL,
  `point_value` int(11) default NULL,
  `promotion_id` int(11) default NULL,
  `discount` decimal(9,2) default '0.00',
  `points_used` int(11) default '0',
  `recycling` tinyint(1) default '0',
  `clothing_donation` tinyint(1) default '0',
  `express` tinyint(1) default '0',
  `free_shipping` tinyint(1) default '0',
  `premium` tinyint(1) default NULL,
  `donations` tinyint(1) default NULL,
  `hangers` tinyint(1) default NULL,
  `points_awarded` tinyint(1) default '0',
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2357 DEFAULT CHARSET=utf8;

